    body {

    }

      font-size: 1.5rem;
      font-weight: bold;
      padding: 10px 20px;
      border: 1px solid #ff0;
      border-radius: 8px;
      background: #333;
      color: #ff0;

      min-width: 100px;

      right: -15px;

      border-radius: 50%;
      width: 30px;
      height: 30px;
      display: flex;
      align-items: center;
      justify-content: center;
      animation: pulse 1s infinite;
    }
    
    .tick-mark {
      position: absolute;
      top: -15px;
      left: -15px;
      font-size: 1.2rem;
      background: #0f0;
      border-radius: 50%;
      width: 30px;
      height: 30px;
      display: flex;
      align-items: center;
      justify-content: center;
      animation: pulse 1s infinite;
    }
    
    .percentage-badge {
      position: absolute;
      bottom: -10px;
      right: -10px;
      font-size: 0.8rem;
      background: #00f;
      border-radius: 15px;
      padding: 2px 8px;
      display: flex;
      align-items: center;
      justify-content: center;
    }
    
    @keyframes pulse {
      0% { transform: scale(1); }
      50% { transform: scale(1.2); }
      100% { transform: scale(1); }
    }
    
    .input-row {
      display: flex;
      justify-content: center;
      gap: 8px;
      margin-bottom: 15px;
    }

    .user-panel {

    function updateTimer() {
      const now = new Date();
      const base = new Date(now.getFullYear(), now.getMonth(), now.getDate(), 5, 30, 0);
      if (now < base) base.setDate(base.getDate() - 1);
      const elapsed = Math.floor((now - base) / 1000);
      const remain = 30 - (elapsed % 30);

      document.getElementById("timer").innerText = `00:${String(remain).padStart(2, '0')}`;
      
      if (remain === 30) {
        fetchCurrentNumbers();
      } else if (remain === 1) {
        clearInputs();
      }
      
      setTimeout(updateTimer, 1000);
    }

      try {

        const data = await res.json();
        
        const latestNumbers = data.data.list.slice(0, 4).map(item => {
          const num = parseInt(item.number);
          return isNaN(num) ? '' : num;
        });
        
        for (let i = 0; i < 4; i++) {
          const inputElement = document.getElementById(`input${i+1}`);
          inputElement.value = latestNumbers[i] !== undefined ? latestNumbers[i] : '';
        }

        processData();
        
      } catch (error) {
        console.error("Fetch error:", error);
      }
    }

      // If dataset2 has a different prediction and dataset1 is uncertain, show dataset2's prediction
      if (prediction1 === "??" && prediction2 !== "??") {
        resultBox.innerText = prediction2;
      }
      
      // Check for matches between datasets
      const predictions = [prediction1, prediction2, prediction3].filter(p => p !== "??");
      
      // If all three datasets agree on the prediction
      if (prediction1 === prediction2 && prediction2 === prediction3 && prediction1 !== "??") {
        resultBox.innerText = prediction1;
        // Add tick mark
        const tickMark = document.createElement('div');
        tickMark.className = 'tick-mark';
        tickMark.innerHTML = '';
        resultBox.appendChild(tickMark);
        // Add 95% badge
        const badge95 = document.createElement('div');
        badge95.className = 'percentage-badge';
        badge95.innerHTML = '95%';
        resultBox.appendChild(badge95);
      } 
      // If two datasets agree on the prediction
      else if (predictions.length >= 2 && new Set(predictions).size === 1) {
        resultBox.innerText = predictions[0];
        // Add fire emoji
        const highChance = document.createElement('div');
        highChance.className = 'high-chance';
        highChance.innerHTML = '';
        resultBox.appendChild(highChance);
        // Add 85% badge if two datasets match
        if (predictions.length === 2) {
          const badge85 = document.createElement('div');
          badge85.className = 'percentage-badge';
          badge85.innerHTML = '85%';
          resultBox.appendChild(badge85);
        }
      }
    }

    // User Panel Script (hidden but functional)
    const accessKey = localStorage.getItem('accessKey');
    const expiresAt = localStorage.getItem('expiresAt');
    
    // Check Firebase for valid key
    function checkAccessKey(key) {
      keysRef.once('value', (snapshot) => {
        const keys = snapshot.val();
        if (keys && keys[key]) {
          const expiryTime = keys[key];
          localStorage.setItem('accessKey', key);
          localStorage.setItem('expiresAt', expiryTime);
          document.getElementById('displayKey').textContent = key;
          document.getElementById('displayExpiry').textContent = new Date(parseInt(expiryTime)).toLocaleString();
          updateCountdown();
        } else {
          logout();
        }
      });
    }
    
    if (!accessKey || !expiresAt) {
      window.location.href = "user_login.html";
    } else {
      checkAccessKey(accessKey);
    }
    
    function updateCountdown() {
      const now = Date.now();
      const remaining = parseInt(expiresAt) - now;
      
      if (remaining <= 0) {
        document.getElementById('countdown').textContent = "EXPIRED";
        logout();
        return;
      }
      
      const days = Math.floor(remaining / (1000 * 60 * 60 * 24));
      const hours = Math.floor((remaining % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
      const mins = Math.floor((remaining % (1000 * 60 * 60)) / (1000 * 60));
      const secs = Math.floor((remaining % (1000 * 60)) / 1000);
      
      document.getElementById('countdown').textContent = 
        `${days}d ${hours}h ${mins}m ${secs}s`;
    }
    
    function logout() {
      localStorage.removeItem('userLoggedIn');
      localStorage.removeItem('accessKey');
      localStorage.removeItem('expiresAt');
      window.location.href = "user_login.html";
    }

    document.addEventListener('DOMContentLoaded', () => {
      updateTimer();
      fetchCurrentNumbers();
      setInterval(updateCountdown, 1000);
      updateCountdown();
    });
  </script>
</body>

</html>
